import React from 'react'
import '../GalleryStyle.css'


function Badge_coloe_status(){

}

const Cards = ({results}) => {
    let display;
    console.log(results)
    if(results){
        display = results.map(x=>{
            let {id , name , image , location , gender , species , status ,type } = x;
            return (
            <div key={id} className='col-3 text-light position-realtive' id='Character_Card'>
                <div className=''>
                    <img src={image} alt="" className="img-fluid" id="CardImage"/>
                    <div id="Cardblur"></div>
                    <div className='content'>
                        <div className="fs-5 fw-bold mb-2">{name}<span> </span><span className='badge bg-success' id='status_badge'>{status}</span></div>
                        <div className="mb-4">
                            <div className="fs-6 bg-dark fw-light text-light">{gender} - {species}</div>
                            <div className="fs-6 fw-light" >last seen in-<br></br><span className='fs-6 text-success fw-normal'>{location.name}</span></div>
                        </div>
                    </div>
                </div>
            </div>
            );
        });
    }else{
        display = "404 - Not Found :("
    }
    return <> {display} </>;
}

export default Cards
